public class Josephus
{

	private class Node  //  private inner class
    {
         Soldier	 data;
         Node        next;


         /**
          *  constructor
          */

         Node(Soldier aSoldier, Node nextNode)
         {
              data = aSoldier;
              next = nextNode;
         }

         Node(Soldier aSoldier)
         {
              data = aSoldier;
              next = this;
         }



    }
    private Node  tail;         // tail of the circular linked list
    private int   numItems;     // number of items in list
    private Node  currentNode;  // point to the current Node,	
                                // it is used by the nextSoldier()
                                // iterator function


     /**
      *  Constructor, - it initializes the circular list to empty.
      */

     public Josephus ()
     {
    	 tail = null;
    	 numItems = 0;
     }



     /**
      *  This method determines whether the list is empty.
      */

     public boolean isEmpty()
     {
    	 return(numItems == 0);
     }



     /**
      *   This method determines the length of a list.
      */

     public int size()
     {
    	 return numItems;
     }



     /**
      *  This method deletes all nodes from the list.
      */

     public void removeAll()
     {
    	 tail = null;
    	 numItems = 0;
     }




     /**
      *  This method inserts a new soldier to the list at
      *  position i.
      *  Note that if the list has n elements, you can insert a
      *  new item only to position 1 .. n+1
      *  @throws IndexOutOfBoundsException If try to insert before
      *          position 1, or after position n+1
      */

     public void insert(Soldier newSoldier, int i) throws IndexOutOfBoundsException
     {
	    if(i >= 1 && i <= numItems + 1)
	    {
	    	Node previous, current, newNode;
	    	if(numItems == 0)
	    	{
	    		System.out.println("A");
	    		numItems++;

	    		newNode = new Node(newSoldier);
	    		tail = newNode;



	    	}else if(i == numItems + 1){
	    		System.out.println("B");
	    		numItems++;

	    		newNode = new Node(newSoldier, tail.next);
				tail.next = newNode;
				tail = newNode;


	    	}else{
	    		System.out.println("C");
		    	numItems++;

		    	 previous = null;
		    	 current = tail;

		    	 for(int k = 0; k <= i; k++)
		    	 {
		    		 previous = current;
		    		 current = current.next;
		    	 }

		    	 newNode = new Node(newSoldier, current.next);
		    	 previous.next = newNode;		    	 

	    	}

    	}else{
    		throw new IndexOutOfBoundsException();
    	}

     }







     /**
      *  This method deletes the ith node from the list.
      *  Note that if the list has n elements, you can only
      *  delete a node at position 1 .. n
      *  @throws IndexOutOfBoundsException If try to insert
      *           before position 1, or after position n
      */

     public void delete(int i) throws IndexOutOfBoundsException
     {
    	 Node previous, current;
    	 numItems--;

    	 previous = null;
    	 current = tail;

    	 for(int k = 0; k <= i-1; k++)
    	 {
    		 previous = current;
    		 current = current.next;
    	 }

    	 previous.next = current.next;
     }




     /**
      *  This method returns the ith soldier from the list.
      *  Note that if the list has n elements, you can only
      *  return the item at position 1 .. n
      *  @throws IndexOutOfBoundsException If try to get
      *           before position 1, or after position n
      */

     public Soldier get(int i) throws IndexOutOfBoundsException
     {
 	    if(i >= 1 && i < numItems + 1){
 	    	Node current = tail;
 	    	for(int k = 0; k <= i-1; k++)
 	    	{
 	    		current = current.next;
 	    	}

 	    	return current.data;

 	    }else{
 	    	throw new IndexOutOfBoundsException();
 		}
     }




     /**
      *  This method determines whether another circular list has
      *  the same contents as this list.
      */

     public boolean equals (Josephus anotherList)
     {
    	if(numItems == anotherList.numItems){	 

    		Node current = tail.next;
    		Node anotherCurrent = anotherList.tail.next;

    		while(current != tail){
    			if(anotherCurrent.data.equals(current.data))
    			{
    				current = current.next;
    				anotherCurrent = anotherCurrent.next;
    			}else{
    				return false;
    			}
    		}

    		return true;
    	}else{

    		return false;
    	}
     }




     /**
      *  This method creates a deep copy (with the same contents,
      *  but in different memory location) of this list.
      */

     public Object clone()
     {
    	 Node p, q;

    	 Josephus newList = new Josephus();

    	 if (numItems != 0){
    		 newList.numItems = numItems;
    		 p = tail.next;
    		 newList.tail = new Node(p.data);
    		 q = newList.tail;

    		 while (p != tail){
    			 q.next = new Node(p.data);
    			 p = p.next;
    			 q = q.next;
    		 }
    	 }

    	 return newList;
     }




     /**
      *  This method returns true or false depending whether or not
      *  there is next soldier of the list to be returned by the
      *  iterator method.  Note that the last node does not have a
      *  null next.  So, how do you determine whether you have
      *  stepped through the entire list?
      */

     public boolean hasNext()
     {
    	 currentNode = tail;
    	 System.out.println(currentNode.data.getName());
    	 if(currentNode == tail)
    	 {
    		 return false;
    	 }else
    	 {
    		 currentNode = currentNode.next;
    		 return true;
    	 }
     }


     /**
      *  The iterator method -  It returns the next soldier of the
      *  list.  Note that the actual record is returned, not a copy
      *  of that record.  In this way, the user may manipulate that
      *  record.  Returns a null pointer when the end of list
      *  is reached.
      */

     public Soldier nextSoldier()
     {
    	 return currentNode.next.data;
     }




     /**
      *  This method resets the position pointer of the iterator
      *  method to the first soldier of the list.
      */

     public void resetCurrentSoldier()
     {
    	 currentNode = tail.next;
     }




     /**
      *  This method performs the elimination process and returns
      *  the last soldier.  Note that when you step through the
      *  circular list to remove each node, your list is destroyed.
      *  To solve this problem, you should clone a list, then work 
      *  and eliminate on the cloned list, rather than on the
      *  original list.
      */

     public Soldier lastSoldier(int m, int n)
     {
    	 Josephus workList = (Josephus) this.clone();
    	 Node p, q;

    	 //workList.resetCurrentSoldier();

    	 p = null;
    	 //q = workList.currentNode;
    	 q = currentNode;

    	 for(int i = 1; i <= m; i++){
    		 p = q;
    		 q = q.next;
    		 //System.out.println("*****" + q.data.getName());
    	 }

    	 while(numItems > 0){
	    	 for(int i = 1; i <= n; i++){
	    		 p = q;
	    		 q = q.next;
	    		 //System.out.println(q.data.getName());
	    	 }

	    	 p.next = q.next;
	    	 //System.out.println(workList.numItems);
	    	 //workList.numItems--;
	    	 numItems--;
    	 } 

    	 return q.data;
     }
}

