	public static String substitutionEncrypt(String plainText, String key) {
		String cipher = "";
		String alphabet = "abcdefghijklmnopqrstuvwxyz ";
		plainText = plainText.toLowerCase();
		for (int i = 0; i < plainText.length(); i++) {
			char c = plainText.charAt(i);
			int idx = alphabet.indexOf(c);
			cipher = cipher + key.charAt(idx);

		}
		return cipher;
	}

	public static String substitutionDecrypt(String cipher, String key) {
		String text = "";
		String alphabet = "abcdefghijklmnopqrstuvwxyz ";
		cipher = cipher.toLowerCase();
		for (int i = 0; i < cipher.length(); i++) {
			char c = cipher.charAt(i);
			int idx = key.indexOf(c);
			text = text + alphabet.charAt(idx);

		}
		return text;
	}

